import React,{Component,useState} from 'react';
import Navbar from './components/navbar';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from './components/button';
import Post from './components/post.js';
import Nero from './img/Nero.jpg';

const posts= [
  {id:0, immagine: Nero, titolo:'titolo1', descrizione:'descrizione1', aggiornamento:'aggiornamento1'},
  {id:1, immagine: Nero, titolo:'titolo2', descrizione:'descrizione2', aggiornamento:'aggiornamento2'},
  {id:2, immagine: Nero, titolo:'titolo3', descrizione:'descrizione3', aggiornamento:'aggiornamento3'},
  {id:2, immagine: Nero, titolo:'titolo4', descrizione:'descrizione4', aggiornamento:'aggiornamento4'},

];



function App(){




    return (
      <Router>
      <div className="App">
       <Navbar/>
       <Button/>
       <hr/>
      {this.state.posts.map(post =>(
        <Post key={post.id} post={post}/>
      ))}
      </div>
      </Router>
    );
  }

export default App;
